import React from 'react';
import BaseLayout from '../components/layouts/BaseLayout';
import axios from 'axios';
import Link from 'next/link';


class Cv extends React.Component{

	render() {
		const data = {
		  content: {
		    fruites: ['Apple', 'Banana', 'Orange']
		  }
		};	
		// debugger
		const titleval = "hiii"
		this.state = { para: "hello", h1: "some"}
		var { para } = this.state;
		const { h1 } = this.state;
		const i = 2;
		return(
	  	 <BaseLayout>
		  	<h1>New CV Page</h1>
		  	<div className="App">
		  	<List items={data.content.fruites}/>

		    </div>	
		  	<div>
		  		<p>{ titleval }</p>
		  		<h1>{ para }</h1>
		  		<h1>{ h1 }</h1>
		  	</div>
	  	</BaseLayout>
	  	)
	}
}
export default Cv;
